const MSGs = [
  {content: "I like this chat room", name: "user1"},
  {conent: "Yea its good ig", name: "saszyBe0tch79"},
];

function Message( {content, name} ) {
  return(
    <li>{content}<span>{name}</span></li>
  );
}

function Messages() {
  const display_msgs = [];

  MSGs.forEach((msg) => {
    display_msgs.push(
      <Message content = {msg.content} name = {msg.name}/>
    );
  });

  return(
    <ul>
      {display_msgs};
    </ul>
  );
}

function MessageBar() {
  return(
    <form>
      <input type = "text" placeholder = "Enter text here..."/>
    </form>
  );
}

function RoomName({name}){
  return(
    <p>{name}</p>
  );
}

function RoomsList({ rooms }){
  const rows = [];

  rooms.forEach((room) => {
    rows.push(
      <RoomName name = {room.name} />
    );
  });

  return(
    <ul>
      {rows}
    </ul>
  );
}

const ROOMS = [
  {name: "fun"},
  {name: "yoga"}
];

function CurrentRoom() {
  return (
    <div id = "room">
      <h1>Welcome to Chat Room</h1>
      <Messages />
      <MessageBar />

    </div>
  );
}

export default function App() {
  return <CurrentRoom />;
}
